import React from 'react';
import './App.css';
import { Box, Paper, Typography, TextField, Button} from '@mui/material';

function App() {
  return (
    <Box sx={{
      width: "200px"
    }}>
      <Paper>
        <Typography>Hi</Typography>
      </Paper>
      <Box>
        <TextField />
        <Button>Sent</Button>
      </Box>

    </Box>
  );
}

export default App;
